import { Flex, Image } from "@chakra-ui/react";
import Search from "./Search";
export default function Nav() {
    return (
        <Flex bg={'white'} height='50px' padding='5px 10px' align={'center'}>
           <Flex>
                <Image src="./logo192.png" height={'40px'}/>
           </Flex>
           <Search/>
        </Flex>
    )
}
